import React from 'react';
import { withBoostoreService } from '../hoc';
import Content from '../content';
import { Route, Switch } from 'react-router-dom';


const App = () => {
    return (
        <div>
            <p>App</p>
            <Route path="/" component={Content} />
        </div>
       
    )       
}

export default App;
